    def specifications_pc_data(self):
            try:
                    mydb = mc.connect(
                            host="localhost",
                            user="root",
                            password="",
                            database="club"
                            )
                    
                    mycursor = mydb.cursor()
                    mycursor.execute("SELECT * FROM specifications_pc")
                    
                    result = mycursor.fetchall()

                    self.table_stories_PC_2.setColumnCount(0)
 
                    for column_number, column_data in enumerate(result):
                            self.table_stories_PC_2.insertColumn(column_number)
 
                            for row, date in enumerate(column_data):
                                self.table_stories_PC_2.setItem(column_number, row, QTableWidgetItem(str(date)))
                    
            except mc.Error as e:
                    print("Error occured")
        
        
